        number = 0;
        ++votingSessionNumber;
        workflowstatus = WorkflowStatus.VoteSessionStart;
        for (uint256 index = 0; index < proposalArray.length; ++index) {
            proposalArray[index].nbvote = 0;
            users[proposalArray[index].addresse].hasvoted = false;
        }
    }

